import Home from './home'

const current = <Home />;

class NewSX extends React.Component {

    constructor(props) {
        super(props);

        this.state = {page: <Home/>};

        this.activePage = this.activePage.bind(this);
    }

    activePage(page) {
        switch(page) {
            case "home":
                this.setState({page: <Home/>});
                break;
            case "register":
                this.setState({page: <Register/>})

        }
    }

    render() {
        return (
            <div className="new_sx">
                <img id="background" src={ Background } alt="" />
                <div className="navBar">
                    <NavBar />
                </div>
                <div className="register_box" >
                    {this.state}
                </div>
            </div>
        );
    }
}

// ========================================

ReactDOM.render(
    <NewSX />,
    document.getElementById('root')
);
